INSERT INTO `orni_sous_niveau` (`Id_sous_niveau`, `Id_niveau`, `Num_sous_niveau`, `Nom_sous_niveau`, `Description_sous_niveau`, `Question_sous_niveau`, `Nb_questions_justes`, `Score_validation`, `Sous_niveau_suivant`)
VALUES
	(1,1,1,'1.1 Oeuf','Trouver l\'intrus : passériformes ou non-passériformes est affiché + 4 photos dont un intrus. Clic sur l\'intrus (la définition du mot passériformes est affichée)','Une de ces espèces n’est pas un passereau.  <br />Cliquez sur l’intrus !',5,80,2),
	(2,1,2,'1.2 Poussin','A partir d\'une photo, identifier passereaux ou non passereaux (QCM)','',5,80,3),
	(3,1,3,'1.3 Juvénile','A partir d\'une photo, identifier le groupe d’appartenance.','',5,80,4),
	(4,1,4,'1.4 Immature','trouver l\'intrus : Le nom du groupe (voir plus bas) est affiché  + 4 photos dont une qui ne fait pas partie du groupe. Clic sur l\'intrus  (accès aux définitions de groupes affichés + critères d\'identification)','',5,80,5),
	(5,1,5,'1.5 Subadulte','A partir d\'une photo, identifier le nom du groupe. 4 propositions (QCM)','',5,80,6),
	(6,1,6,'1.6 Adulte','A partir d\'une photo, identifier le nom du groupe (liste de tous les groupes)','',5,80,0),
	(7,2,1,'2.1 Duvet','La photo à identifier + 4 autres photos, 3 de familles différentes sauf une. Le nom de la famille est inscrit au-dessus. Faire glisser (ou cliquer/cocher) sur la photo qui semble de la même famille de celle à identifier.','',5,80,8),
	(8,2,2,'2.2 Plume','trouver l\'intrus : Un nom de la famille est affiché + 4 photos. L\'intrus fait partie d\'un ordre différent (accès à la définition des familles affichées)','',5,80,9),
	(9,2,3,'2.3 Alula','trouver l\'intrus : Un nom de la famille est affiché + 4 photos. L\'intrus fait partie du même ordre mais d\'une famille proche (F +- 1) (accès à la définition des familles affichées)','',5,80,10),
	(10,2,4,'2.4 Rémige','A partir d\'une photo, identifier le nom de la famille. 4 noms sont proposés. (QCM)','',5,80,11),
	(11,2,5,'2.5 Rectrice','A partir d\'une photo, identifier le nom de la famille d\'appartenance (complétion et/ou liste)','',5,80,12),
	(12,3,1,'3.1 Mésange','La photo à identifier + 4 autres. 3 de genres différents (même famille ou famille proche). Le nom vernaculaire est inscrit au-dessus.  (glisser ou cliquer/cocher) sur la photo qui semble du même genre','',5,80,13),
	(14,3,2,'3.2 Merle','trouver l\'intrus : Un nom de genre est affiché + 4 photos. L\'intrus fait partie d\'une famille différente','',5,80,15),
	(15,3,3,'3.3 Faucon','A partir d\'une photo, trouver le genre. 4 noms sont proposés. (QCM)','',5,80,16),
	(16,3,4,'3.4 Aigle','A partir d\'une photo, trouver le genre (complétion et/ou liste)','',5,80,17);
